__NUXT_JSONP__("/Detail/7/2", (function(a,b){b.id=7;b.title="{\"latin_name\":\"This picture is for women who like to hang out a lot: You always think that your girlfriend is narrow-minded and forbids you to go out. Do you know why?\",\"local_name\":\"រូបភាពនេះ ជូនចំពោះនារីៗដែលចូលចិត្តដើរលេងច្រើន៖ អ្នកតែងតែគិតថា សង្សាររបស់អ្នកជាមនុស្សចិត្តចង្អៀត ហាមអ្នកមិនឲ្យដើរលេង។ អ្នកដឹងថាហេតុអីអត់?\"}";b.description="{\"latin_name\":\"This picture is for women who like to hang out a lot:\\nYou always think that your girlfriend is narrow-minded and forbids you to go out. Do you know why? Because he is a man, he knows everything about men. Your girlfriend does not let you drink, do not hang out too much, do not let you dress sexy, pop up and down ... all this is just to protect you. I do not forbid You hang out, but you have to know the time, I do not want you to get drunk, everything has a reason\",\"local_name\":\"រូបភាពនេះ ជូនចំពោះនារីៗដែលចូលចិត្តដើរលេងច្រើន៖\\nអ្នកតែងតែគិតថា សង្សាររបស់អ្នកជាមនុស្សចិត្តចង្អៀត ហាមអ្នកមិនឲ្យដើរលេង។ អ្នកដឹងថាហេតុអីអត់? ពីព្រោះតែគាត់ជាមនុស្សប្រុស គាត់ដឹងគ្រប់យ៉ាងពីមនុស្សប្រុស។សង្សារអ្នកមិនឲ្យអ្នកផឹកស៊ី មិនឲ្យដើរលេងច្រើន មិនឲ្យអ្នកស្លៀកពាក់ស៊ិចស៊ី លេចលើ លេចក្រោម... ទាំងអស់នេះ គឺគ្រាន់តែចង់ការពារអ្នក។ខ្ញុំមិនហាមអ្នកដើរលេងទេ តែអ្នកត្រូវដឹងពេលដឹងវេលា​, ខ្ញុំមិនចង់ឲ្យអ្នកផឹកស្រវឹងខ្លាំង គ្រប់យ៉ាងសុទ្ធតែមានមូលហេតុរបស់វា\"}";b.image="6405f6dcea9651.30450625.png";b.text="\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E";b.date=a;b.created_at="2023-03-06T21:45:38.000000Z";b.updated_at="2023-03-06T14:45:38.000000Z";b.type=2;return {data:[{meta:b}],fetch:{"Detail:0":{detail:{},url:"\u002FDetail\u002F7\u002F2",image_share:void 0,id:a,type:a,relate_content:[],image:"",meta:b}},mutations:[]}}(null,{})));